import React, { Component } from 'react';

import AppBar from '../../components/AppBar/AppBar';
import Drawer from '../../components/Drawer/Drawer';

export default class NewLayoutView extends Component {
   render() {
      return (
         <div>
            <AppBar></AppBar>
            <Drawer></Drawer>
         </div>
      );
   }
}
